import React, { useState } from "react"

import { ReactComponent as Html } from "./svgs/brands/html5.svg";
import { ReactComponent as Css } from "./svgs/brands/css3-alt.svg";
import { ReactComponent as JavaScript } from "./svgs/brands/js.svg";
import { ReactComponent as Reactjs } from "./svgs/brands/react.svg";
import { ReactComponent as Bootstrap } from "./svgs/brands/bootstrap.svg";

import { ReactComponent as Ejs } from "./svgs/brands/ejs.svg";
import { ReactComponent as Jquery } from "./svgs/brands/jquery.svg";

import { ReactComponent as Less } from "./svgs/brands/less.svg";
import { ReactComponent as Git } from "./svgs/brands/git-alt.svg";
import { ReactComponent as Github } from "./svgs/brands/github.svg";

import { ReactComponent as Seo } from "./svgs/brands/seo.svg";
import { ReactComponent as Security } from "./svgs/brands/security.svg";

import { ReactComponent as Nodejs } from "./svgs/brands/node.svg";

import { ReactComponent as Mongodb } from "./svgs/brands/mongodb.svg";
import { ReactComponent as Express } from "./svgs/brands/express.svg";
import { ReactComponent as Sql } from "./svgs/brands/sql.svg";
import { ReactComponent as HyperTerminal } from "./svgs/brands/hyperterminal.svg";
import { ReactComponent as Vscode } from "./svgs/brands/vscode.svg";

function Projects(){

  const [navIconClicked, setNavIconClicked] = useState("navbar-toggler-icon");
  const [isClicked, setIsClicked] = useState(false);

  const [fadeOutMenu, setFadeOutMenu] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });
  const [isMenuClicked, setIsMenuClicked] = useState(false);

  const [fadeOutTitles, setFadeOutTitles] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });

  const [normalH3, clickH3] = useState("Projects");

  function handleClick(){
    if (!isClicked) {
      setNavIconClicked("navbarClicked");
      clickH3("");
      setIsClicked(true)
    }else{
      setNavIconClicked("navbarClicked2");
      clickH3("Projects");
      setIsClicked(false)
    }

    if (!isMenuClicked) {
      setFadeOutMenu({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setFadeOutTitles({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setIsMenuClicked(true);
    }
    else{
      setFadeOutMenu({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setFadeOutTitles({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setIsMenuClicked(false);
    }
  };

    return (

      <>

      <section id="skills" class="skills-section color-443829">
            <div class="overlay2"></div>
            <h3 style={fadeOutTitles}>{normalH3}</h3>

            <div class="skill-list">

            <Html class="skill1 circle" />
            <p class="skill1-text">HTML</p>

            <Css class="skill2 circle" />
            <p class="skill2-text">CSS</p>
            
            <JavaScript class="skill3 circle" />
            <p class="skill3-text">JavaScript</p>
            
            <Reactjs class="skill4 circle" />
            <p class="skill4-text">React</p>
            
            <Bootstrap class="skill5 circle" />
            <p class="skill5-text">Bootstrap</p>
            
            <Ejs class="skill6 circle" />
            <p class="skill6-text">EJS</p>
            
            <Jquery class="skill7 circle" />
            <p class="skill7-text">jQuery</p>
            
            <Less class="skill8 circle" />
            <p class="skill8-text">Less</p>
            
            <Git class="skill9 circle" />
            <p class="skill9-text">Git</p>
            
            <Github class="skill10 circle" />
            <p class="skill10-text">Github</p>
            
            <Seo class="skill11 circle" />
            <p class="skill11-text">SEO</p>
            
            <Security class="skill12 circle" />
            <p class="skill12-text">Security</p>
            
            <Nodejs class="skill13 circle" />
            <p class="skill13-text">Node.js</p>
            
            <Mongodb class="skill14 circle" />
            <p class="skill14-text">MongoDB</p>
            
            <Express class="skill15 circle" />
            <p class="skill15-text">Express</p>
            
            <Sql class="skill16 circle" />
            <p class="skill16-text">SQL</p>
            
            <HyperTerminal class="skill17 circle" />
            <p class="skill17-text">HyperTerminal</p>
            
            <Vscode class="skill18 circle" />
            <p class="skill18-text">VS Code</p>

</div>

      </section> 

  <header>
  <div class="pos-f-t" id="my-navbar-collapse">
      <div class="collapse navbar-collapse" id="navbarToggleExternalContent">
        <div class="menu" style={fadeOutMenu}>
          <ul class="nav navbar-nav">
            <li>
              <a class="nav-link nav-links" href="/about">About</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/skills">Skills & Tools</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/projects">Projects</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/contact">Contact</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="Jeffin_Jaison_Resume.pdf">
              <svg class="download-button" xmlns="http://www.w3.org/2000/svg" width="25" height="25" viewBox="0 0 24 24"><path d="M19 9h-4V3H9v6H5l7 7 7-7zM5 18v2h14v-2H5z"/></svg>
              Resume</a>
            </li>
          </ul>
        </div>
      </div>
      <nav class="navbar navbar-dark">
        <button class="navbar-toggler" 
        type="button" 
